// Study.js
import React from 'react';
import { FaHome, FaHistory, FaChalkboardTeacher } from 'react-icons/fa';
import './Study.css';

const Study = () => {
    return (
        <div className="study-page">
            {/* Header */}
            <header className="header">
                <div className="logo">QUIZZIZ</div>
                <input type="text" placeholder="Search quiz" className="search-bar" />
                <nav className="nav">
                    <a href="#"><FaHome /> Home</a>
                    <a href="#"><FaHistory /> Activity</a>
                    <a href="#"><FaChalkboardTeacher /> Classes</a>
                </nav>
                <button className="guidance-board">Guidance Board</button>
            </header>

            {/* Join Section */}
            <section className="join-section">
                <input type="text" placeholder="Enter join code" className="join-input" />
                <button className="join-button">Join</button>
            </section>

            {/* Profile Card */}
            <aside className="profile-card">
                <h3>Hello, Quach</h3>
                <button className="coin-button">Require 100 Coins</button>
                <p className="coin-balance">500 coins</p>
            </aside>

            {/* Categories */}
            <main className="categories">
                <Category title="Ice Breaker" />
                <Category title="Math" />
                {/* Add more categories as needed */}
            </main>
        </div>
    );
};

// Category component
const Category = ({ title }) => {
    return (
        <div className="category">
            <h2>{title}</h2>
            <div className="quiz-cards">
                {/* Example Quiz Cards */}
                <QuizCard title="Around the World" questions={8} plays="80k" />
                <QuizCard title="True or False" questions={12} plays="129k" />
                {/* Add more cards as needed */}
            </div>
        </div>
    );
};

// Quiz Card component
const QuizCard = ({ title, questions, plays }) => {
    return (
        <div className="quiz-card">
            <div className="quiz-info">
                <p className="quiz-title">{title}</p>
                <p className="quiz-questions">{questions} Qs</p>
                <p className="quiz-plays">{plays} plays</p>
            </div>
        </div>
    );
};

export default Study;
